import React, {Component} from 'react';
import Time from './Time';
import Partida from './Partida';

export default class PlacarContainer extends Component{

  render(){
    return(
      <div>
        <div style={{float:"left", "marginRight": "10px"}}>
          <Time />
        </div>
        <div style={{float:"left", "marginRight": "10px"}}>
          <Partida />
        </div>
        <div style={{float:"left", "marginRight": "10px"}}>
          <Time />
        </div>
      </div>
    );
  }

}
